INSERT INTO `notice` VALUES (51,'<p>1. 성남시청소년재단 분당서현청소년수련관에서는 4차 산업혁명 및 탄소중립 실천을 꿈꾸는 청소년을 응원하고자『제13회 성남시청소년창의과학축제』를 개최합니다.</p><p>2. 이에, 축제 운영에 필요한 봉사자를 모집하오니 많은 참여바랍니다.</p>','2022-08-18 16:29:181','[공통] 제13회 성남시청소년창의과학축제 자원봉사자 모집 안내','0e729d22-bdfb-4a09-8ffb-012887623481','S0900005450305','teacher'),(52,'<p>가천대학교 산학협력단 산학기획팀에서는</p><p>대학혁신사업과 관련하여, 학부생 인턴쉽 프로그램을 진행하고 있습니다.&nbsp;</p><p><br></p><p><br></p><p>관심 있는 학부생들의 많은 참여를 부탁드립니다.&nbsp;</p><p><br></p><p><br></p><p>가. 프로그램명 : Field task R&amp;D(현장과제해결형)학부인턴쉽</p><p><br></p><p><br></p><p>나. 프로그램 내용 :&nbsp;</p><p>&nbsp; &nbsp; -&nbsp;지도교수를 중심으로, 1-2명의 학부생이 한 팀이 되어 지원 기업의 애로기술사항 또는</p><p>&nbsp; &nbsp; &nbsp; 기업이 도움 받고자 하는 컨설팅 가능 사항을 도출하고 이를 해결하기 위한 현장과제해결형 인턴십을 수행</p><p><br></p><p><br></p><p>다. 선발예정 인원 : 약 8개팀 이내, 17명(1개 팀 =1~2명 이내 학생 구성)</p><p><br></p><p><br></p><p>라. 과제수행기간 : 4개월(9~12월)</p><p><br></p><p><br></p><p>마. 과제 선정 및 수행 절차 :</p><p>&nbsp; &nbsp; - 연구계획서 제출 &gt; 심사, 평가, 선정 &gt; 인턴십 수행 &gt; 보고서 제출 &gt; 장학금 지급</p><p><br></p><p><br></p><p>바. 참여 특전 : 참여 학생에게는 학술지원 및 연구수행 보조 형식의 장학금 80만원 지급 예정(활동 종료 후)</p><p><br></p><p><br></p><p>사. 지원분야 : 지도교수 및 학부생의 전공과 연관된 학교 내 모든 분야&nbsp;</p><p><br></p><p><br></p><p>아. 공고기간 : ~ 2022. 09. 02(금)&nbsp;</p><p><br></p><p><br></p><p>자. 제출방법 :&nbsp;</p><p>&nbsp; &nbsp; - 제출서류 :&nbsp;[붙임1,2] 인턴십 연구계획서, 기업애로 해결의뢰서 &nbsp;</p><p>&nbsp; &nbsp;&nbsp;- 제출처 : 산학기획팀 이메일&nbsp;(hsy21@gachon.ac.kr, 내선 6979)</p><p><br></p><p><br></p><p><br></p><p><br></p><p>※ 자세한 사항은 아래 첨부된 접수서류를 참조하여 주시기 바랍니다.&nbsp;</p>','2022-08-18 16:31:702','[공통] 2022-2학기 Field task R&D(현장과제해결형)학부인턴쉽 모집',NULL,'S0900005450305','teacher1'),(57,'<p><strong>[2022-1학기 성적향상 장학금 신청 안내]</strong></p><p><br></p><p><br></p><p><br></p><p><br></p><p>&nbsp;&nbsp;가.&nbsp;장학명&nbsp;: 2022-1학기 성적향상 장학금&nbsp;</p><p>&nbsp; 나.&nbsp;대상자 (글로벌 및 메디컬캠퍼스 학생)</p><p>&nbsp; &nbsp;-&nbsp;22-1학기 성적이 이전학기 성적보다&nbsp;1.5이상 상승한&nbsp;22-1학기 등록금 납부&nbsp;재학생 및 휴학생</p><p>&nbsp; &nbsp;&nbsp;1)&nbsp;이전학기&nbsp;:&nbsp;평균평점&nbsp;2.0이상</p><p>&nbsp; &nbsp;&nbsp;2)&nbsp;22-1학기 성적&nbsp;: 12학점 및 평균평점&nbsp;3.5이상(P/F과목 제외,&nbsp;재수강 포함)</p><p>&nbsp;&nbsp;다.&nbsp;장학금액&nbsp;: 1인당&nbsp;500,000원&nbsp;(생활비 성격의 학업장려금으로 등록금 범위 초과 가능)</p><p>&nbsp; &nbsp;&nbsp;-&nbsp;예산 초과 시, 성적향상 점수가 높은 순으로 순차적 선발</p><p>&nbsp; 라.&nbsp;신청기간&nbsp;: 2022.07.22(금) 13시&nbsp;까지 [기한엄수]</p><p>&nbsp; 마. 신청방법&nbsp;: \"붙임\" 자료 참조</p><p>&nbsp; 바. 지급일정 : 2022.08.12(금) 예정</p><p>&nbsp; 사. 문&nbsp; &nbsp; &nbsp; 의 : 031-750-5056</p><p><br></p><p><br></p>','2022-08-19 09:53:709','[공통] 2022-1학기 성적향상 장학금 신청 안내',NULL,'S0900005450305','teacher1'),(58,'<p>한국지역아동센터연합회의 요청에 따라, 대학생 멘토와 지역아동센터 아동 멘티를 위한&nbsp;<span style=\"color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal;\">한국지역아동센터연합회의 요청에 따라, 대학생 멘토와 지역아동센터 아동 멘티를 위한&nbsp;</span></p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">멘토링 서포터즈 사업을 진행하기 위해 시행하는 [The가꿈 7기 대학생 가꾸미 모집]을</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">아래와 같이 안내 합니다.&nbsp;</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\"><br style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased;\"></p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">1. 모집기간 : 2022년 7월 11일(월) ~ 7월 22일(금) 정오(12:00)까지 12일간 *모집기간연장</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">2. 모집대상 : 서울, 경기, 인천 소재 대학교 재학생 88명</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">&nbsp; &nbsp;*제외대상: 4학년 2학기 재학생, 휴학생, 대학원생, 인턴 지원예정자 등 멘토링 기간 중 학업 중단 예정자)</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">3. 활동내용 : 2022년 8월 – 2023년 4월 / 총 100시간</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">&nbsp; &nbsp;▶ 지역아동센터 아동 대상 비대면&amp;대면 1:1 학습지도 멘토링 및 정서지원 활동 진행</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">&nbsp; &nbsp;▶ 활동 기간 중 교육 4회 필수 수강</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">4. 참여혜택 | 멘토링 장학금 300만 원 지원(학기별 150만원 지원) 등</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">5. 신청방법 : 구글접수(설문지 작성) 및 서류 E-mail (hjy4u.sns@gmail.com) 접수</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">&nbsp; &nbsp;※ 반드시 두 가지 항목 모두 접수해야 함</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">&nbsp; &nbsp;※ 구글설문지 링크 및 서류양식은 연합회 홈페이지 [공지사항] 확인가능(www.hjy.kr)</p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">&nbsp; &nbsp;※ 구글 설문지 링크 :&nbsp;<a href=\"https://forms.gle/9BrJJow1AgBAo7Ap6\" style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; border: 0px none; transition: all 0.4s cubic-bezier(0.5, 0, 0.3, 1) 0s; text-decoration-line: none; color: inherit;\">https://forms.gle/9BrJJow1AgBAo7Ap6</a></p><p style=\"box-sizing: border-box; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Noto Light&quot;; font-size: 16px; font-variant-ligatures: normal; letter-spacing: -0.8px; text-align: start; white-space: normal; word-break: keep-all !important;\">6. 기타 자세한 사항은 첨부 참조</p>','2022-08-19 09:53:645','[공통] The가꿈 7기 대학생 멘토링 사업 참여자 모집',NULL,'S0900005450305','teacher'),(59,'<p>학교 추천 대상자 입니다. 재단에서는 학교 추천자&nbsp;10명중 7명을 최종 선발 예정입니다.</p><p>본인 확인이 어려울 경우 장학복지팀으로 연락 주시기 바랍니다(내선 5057).</p><table><thead><tr><th><p>학번</p></th><th><p>성명</p></th></tr></thead><tbody><tr><td><p>2021***23</p></td><td><p>박*언</p></td></tr><tr><td><p>2021***32</p></td><td><p>문*윤</p></td></tr><tr><td><p>2021***15</p></td><td><p>김*현</p></td></tr><tr><td><p>2021***84</p></td><td><p>이*린</p></td></tr><tr><td><p>2021***45</p></td><td><p>이*선</p></td></tr><tr><td><p>2021***53</p></td><td><p>추*희</p></td></tr><tr><td><p>2019***37</p></td><td><p>이*희</p></td></tr><tr><td><p>2021***18</p></td><td><p>박*지</p></td></tr><tr><td><p>2021***17</p></td><td><p>박*솔</p></td></tr><tr><td><p>2021***30</p></td><td><p>이*원</p></td></tr></tbody></table><p><br></p><p><br></p>','2022-08-19 09:54:441','[글로벌] 선발결과',NULL,'S0900005450305','teacher2');
